package codes.hard.slidingwindow;

import java.util.HashMap;
import java.util.Map;


public class MinimumWindowSubstring {

    public String minWindow(String s, String t) {
        //新建两个Map，needMap存储t中每个字符出现的次数
        //windowMap存储滑动窗口中字符出现的次数，用于判断窗口是否满足
        //1.初始化t的map数组
        Map<Character,Integer> needMap = new HashMap<>();
        for(int i=0;i<t.length();i++){
            Integer num = needMap.get(t.charAt(i));
            if(num == null){
                needMap.put(t.charAt(i),1);
            }else {
                needMap.put(t.charAt(i),num+1);
            }
        }
        int start=0,minLen = 0;
        //left和right代表滑动窗口的前后边界
        //match用于表示t中的字符和window中字符匹配的个数
        int left=0,right=0,match=0;
        Map<Character,Integer> windowMap = new HashMap<>();
        while(right < s.length()){
            Character k = s.charAt(right++);
            if(needMap.containsKey(k)){
                Integer num = windowMap.get(k);
                if(num == null){
                    windowMap.put(k,1);
                }else {
                    windowMap.put(k,num+1);
                }
                //如果个数匹配上了，match+1
                if(needMap.get(k).equals(windowMap.get(k))){
                    match++;
                }
            }
            //如果有匹配的，移动窗口的前边界，再判断是否匹配
            while(match == needMap.size()){
                if(minLen == 0 || minLen > right-left){
                    start = left;
                    minLen = right-left;
                }
                char key = s.charAt(left++);
                if(windowMap.containsKey(key)){
                    Integer num = windowMap.get(key);
                    if(num == 1){
                        windowMap.remove(key);
                        match = match-1;
                    }else{
                        windowMap.put(key,num-1);
                        if(windowMap.get(key) < needMap.get(key)){
                            match = match-1;
                        }
                    }
                }
            }
        }
        return s.substring(start,start+minLen);
    }

    public static void main(String[] args) {
        String a = "";
        String b = "";
        System.out.println(new MinimumWindowSubstring().minWindow(a,b));
    }

}
